import React from "react";
import * as Scroll from "react-scroll";

const SectionNavigation = ({ nav }) => {
  let ScrollLink = Scroll.ScrollLink;

  return (
    <button className="navButton">
      <h5>
        {nav.label}
        <span>{nav.name}</span>
      </h5>
    </button>
  );
};

export default SectionNavigation;
